class User {
  final String? id;
  final String? username;
  final String? password;
  final String? email;
  final String? fullName;
  final String? phoneNumber;
  final String? address;
  final String? location;
  final String? ipAddress;
  final String? deviceId;

  User(
      {this.id,
      this.username,
      this.password,
      this.email,
      this.fullName,
      this.phoneNumber,
      this.address,
      this.location,
      this.ipAddress,
      this.deviceId});
}
